import { Input } from '@material-ui/core';
import React from 'react'

const Navbar = () => {
    return (
        <>
            <nav class="navbar stiky-top navbar-dark bg-dark">
                <a class="navbar-brand" href="#">Navbar</a>
                <form class="form-inline my-2 my-lg-0">
                    <input class="form-control mr-sm-1" type="search" placeholder="Search" onChange={(e)=>setsearchTerm(e.target.value)} 
                            id="search" 
                            value={searchTerm} 
                            aria-label="Search" />
                    <button class="btn btn-outline-success my-1 my-sm-0" type="submit"><Link to={`/searchProfile/${searchTerm}`} ><button className="btn_search"  ><i className="fa fa-search"></i></button></Link>
</button>
                </form>

            </nav>
        </>
    )
}

export default Navbar;
